def findpadlen(items)
  padlen = 0
  items.each do |itm|
    len = itm.length
    if len > padlen then
      padlen = len
    end
  end
  return padlen
end

begin
  maxitmperline = 15
  itembits = itemsrc.split(/,/).map(&:strip).reject(&:empty?)
  i = 0
